import { useSelector } from "react-redux";
import styles from "./Contact.module.css"

function Contact() {
  const Dark = useSelector((state)=>state.dark)
  const Language = useSelector((state)=>state.english)

  return (
    <div className={Dark ? styles.ContainerDark : styles.ContainerLight}>
      <div>
        <p>{Language ? "Contact" : "Contacto"}</p>
      </div>
      <div className={styles.inputContainer}>
        <input type="text" placeholder={Language ? "Name:" : "Nombre:"}></input>
        <input type="text" placeholder={Language ? "LastName:" : "Apellido:"}></input>
        <textarea placeholder={Language ? "Message" : "Mensaje"}></textarea>
      </div>
    </div>
  );
}

export default Contact;
